import React from 'react'

export default function Header() {
  return (
    <div className='header'>
        <div className='headerTitles'>
            <span className='headerTitlesSmall'>React and Node</span>
            <span className='headerTitlesLarge'>Blog</span>
        </div>
        <img className='headerImg' src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.avenuecalgary.com%2Fthings-to-do%2Fsocial-distancing-in-the-great-outdoors-how-to-enjoy-the-mountains-right-now%2F&psig=AOvVaw3xo9T0p24IZcSJ-YG_hSfK&ust=1719352239858000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCOjKrK-c9YYDFQAAAAAdAAAAABAK' alt='img'></img>
    </div>
  )
}
